var walletService;

// src/commands/wallet/create.ts
async function fetchMintList() {
  const list = await ndk.fetchEvents({
    kinds: [38172]
  });
  return Array.from(list);
}
async function createWallet(name, mints, unit) {
  let walletName = name;
  let selectedMints = mints;
  let walletUnit = unit;
  if (!walletName) {
    const { inputWalletName } = await lib_default.prompt([
      {
        type: "input",
        name: "inputWalletName",
        message: "Enter a name for your wallet:"
      }
    ]);
    walletName = inputWalletName;
  }
  if (!selectedMints || selectedMints.length === 0) {
    const mintList = await fetchMintList();
    const mintUrls = mintList.map((event) => event.tagValue("u")).filter((url) => url !== undefined);
    console.log("Available Mint URLs:", mintUrls);
    const { userSelectedMints } = await lib_default.prompt([
      {
        type: "checkbox",
        name: "userSelectedMints",
        message: "Select one or more mint URLs:",
        choices: mintUrls,
        validate: (answer) => {
          if (answer.length < 1) {
            return "You must choose at least one mint URL.";
          }
          return true;
        }
      }
    ]);
    selectedMints = userSelectedMints;
  }
  if (!walletUnit) {
    const { inputUnit } = await lib_default.prompt([
      {
        type: "input",
        name: "inputUnit",
        message: "Enter the unit for your wallet:",
        default: "sats"
      }
    ]);
    walletUnit = inputUnit;
  }
  console.log("Selected mint URLs:", selectedMints);
  const wallet = new NDKCashuWallet(undefined, ndk);
  wallet.name = walletName;
  wallet.mints = selectedMints;
  wallet.relays = ndk.pool.connectedRelays().map((relay) => relay.url);
  wallet.unit = walletUnit;
  await wallet.publish();
  console.log("Wallet created:", wallet.event.encode());
  return wallet;
}

// src/commands/wallet/set-nutzap-wallet.ts
async function setNutzapWallet(walletId) {
  const walletEvent = await ndk.fetchEvent(walletId);
  if (!walletEvent) {
    console.error("Wallet not found");
    return;
  }
  const wallet = await NDKCashuWallet.from(walletEvent);
  if (!wallet) {
    console.error("Wallet invalid", walletEvent.rawEvent());
    return;
  }
  const mintList = new NDKCashuMintList(ndk);
  mintList.mints = wallet.mints;
  mintList.relays = wallet.relays;
  if (wallet.p2pk)
    mintList.p2pk = wallet.p2pk;
  await mintList.publishReplaceable();
  console.log("Nutzap wallet set: https://njump.me/", mintList.encode());
}

// src/commands/wallet/list.ts
async function listWallets(all = false) {
  const wallets = walletService.wallets;
  for (const wallet of wallets) {
    if (wallet instanceof NDKCashuWallet) {
      console.log(`Wallet: \x1B[96m${wallet.name ?? "Unnamed"}\x1B[0m`);
      if (all) {
        console.log(`Type: \x1B[93m${wallet.type}\x1B[0m`);
        console.log(`Wallet ID: \x1B[96m${wallet.event.encode()}\x1B[0m`);
        console.log(`Mints:`);
        for (const mint of wallet.mints) {
          console.log(`  Mint: \x1B[96m${mint}\x1B[0m`);
        }
      }
      const balance = await wallet.balance();
      if (balance) {
        for (const b of balance) {
          console.log(`  Balance: \x1B[96m${b.amount} ${b.unit}\x1B[0m`);
        }
      }
      console.log();
    }
  }
}

// src/commands/wallet/deposit.ts
var import_qrcode_terminal = __toESM(require_main2(), 1);
async function depositToWallet(mintUrl, amount, unit) {
  const wallets = walletService.wallets;
  let wallet;
  if (wallets.length === 1) {
    wallet = wallets[0];
  } else if (wallets.length > 1) {
    const { selection } = await lib_default.prompt([
      {
        type: "list",
        name: "selection",
        message: "Select a wallet to deposit to:",
        choices: wallets.filter((w) => w instanceof NDKCashuWallet).map((w) => `${w.name ?? "Unnamed"} (${w.event.encode()})`),
        validate: (input) => {
          if (!input) {
            return "You must select a wallet.";
          }
          return true;
        }
      }
    ]);
    console.log({ selection });
    wallet = wallets.find((w) => w instanceof NDKCashuWallet && selection.includes(w.event.encode()));
  }
  if (!wallet) {
    console.log("No wallet selected.");
    return;
  }
  let mint;
  if (mintUrl) {
    mint = mintUrl;
  } else {
    const { selectedMint } = await lib_default.prompt([
      {
        type: "list",
        name: "selectedMint",
        choices: wallet.mints,
        message: "Select the mint to deposit to:"
      }
    ]);
    mint = selectedMint;
  }
  if (!amount || !unit) {
    const answers = await lib_default.prompt([
      {
        type: "input",
        name: "amount",
        message: "Enter the amount to deposit:",
        when: !amount
      },
      {
        type: "input",
        name: "unit",
        message: "Enter the unit for the amount:",
        default: wallet.unit,
        when: !unit
      }
    ]);
    amount = amount || answers.amount;
    unit = unit || answers.unit;
  }
  const deposit = await wallet.deposit(amount, mint, unit);
  const pr = await deposit.start();
  console.log(`Payment Request from ${mint}:`);
  console.log(`\x1B[1;37m${pr}\x1B[0m`);
  import_qrcode_terminal.default.generate(pr, { small: true }, (qrcode2) => {
    console.log(qrcode2);
  });
  await new Promise((resolve) => {
    deposit.on("success", (token) => {
      console.log(`Deposit successful: ${token.id}`);
      resolve(token);
    });
    deposit.on("error", (error) => {
      console.error(`Deposit failed: ${error}`);
      resolve(error);
    });
  });
}

// src/commands/wallet/tokens.ts
async function listTokens() {
  const wallets = walletService.wallets;
  for (const wallet of wallets) {
    if (!(wallet instanceof NDKCashuWallet))
      continue;
    console.log(source_default.white(wallet.name));
    for (const token of wallet.tokens) {
      const { amount, mint, proofs } = token;
      console.log("  " + source_default.green(amount), source_default.gray(`(${mint})`) + source_default.yellow(` (${proofs.length} proofs)`));
    }
  }
}

// src/main.ts
async function promptForNsec() {
  const { nsec } = await lib_default.prompt([
    {
      type: "password",
      name: "nsec",
      message: "Enter your NSEC key:",
      validate: (input) => input.length > 0 || "NSEC key cannot be empty"
    }
  ]);
  return nsec;
}
async function ensureNsec() {
  if (!currentNsec) {
    currentNsec = await readNsecFromFile();
    if (!currentNsec) {
      currentNsec = await promptForNsec();
      await handleNsecCommand(currentNsec);
    }
  }
}
async function promptForCommand() {
  const { command } = await lib_default.prompt([
    {
      type: "input",
      name: "command",
      message: 'Enter a command (or "help" for available commands, "exit" to quit):'
    }
  ]);
  if (command.toLowerCase() === "help") {
    console.log("Available commands:");
    console.log("  help                - Show this help message");
    console.log("  create              - Create a new wallet");
    console.log("  set-nutzap-wallet [naddr...]   - Set the NIP-60 wallet that should receive nutzaps");
    console.log("  ls [-l]             - List wallets (use -l to show all details)");
    console.log("  deposit             - Deposit funds to a wallet");
    console.log("  exit                - Quit the application");
    console.log("  create-wallet       - Create a new wallet with specified options");
    console.log("  ls-tokens           - List all tokens in the wallet");
  } else if (command.toLowerCase() === "create") {
    const createdWallet = await createWallet();
    if (createdWallet) {
      const { setAsNutzap } = await lib_default.prompt([
        {
          type: "confirm",
          name: "setAsNutzap",
          message: "Do you want to set this wallet as the Nutzap wallet?",
          default: false
        }
      ]);
      if (setAsNutzap) {
        await setNutzapWallet(createdWallet.event.encode());
      }
    }
  } else if (command.toLowerCase().startsWith("set-nutzap-wallet")) {
    const naddr = command.split(" ")[1];
    await setNutzapWallet(naddr);
  } else if (/^ls($|\s)/.test(command.toLowerCase())) {
    const args = command.split(" ");
    const showEll = args.includes("-l");
    await listWallets(showEll);
  } else if (command.toLowerCase() === "deposit") {
    await depositToWallet();
  } else if (command.toLowerCase() === "exit") {
    console.log("Goodbye!");
    process.exit(0);
  } else if (command.toLowerCase() === "create-wallet") {
    const { name, mints, unit } = await lib_default.prompt([
      {
        type: "input",
        name: "name",
        message: "Enter the wallet name:"
      },
      {
        type: "input",
        name: "mints",
        message: "Enter mint URLs (comma-separated):"
      },
      {
        type: "input",
        name: "unit",
        message: "Enter the default unit:"
      }
    ]);
    const mintUrls = mints.split(",").map((url) => url.trim());
    await createWallet(name, mintUrls, unit);
  } else if (command.toLowerCase() === "ls-tokens") {
    await listTokens();
  } else {
    try {
      await program2.parseAsync(command.split(" "), { from: "user" });
    } catch (error) {
      console.error("Error:", error.message);
    }
  }
  await promptForCommand();
}
async function startInteractiveMode() {
  console.log('Welcome to the interactive CLI. Type "help" for available commands or "exit" to quit.');
  await ensureNsec();
  await initNdk(relays, currentNsec);
  await initWallet();
  await promptForCommand();
}
async function main() {
  program2.parse(process.argv);
  const options = program2.opts();
  if (options.nsec) {
    currentNsec = options.nsec;
    await handleNsecCommand(currentNsec);
  }
  if (options.relay) {
    relays = options.relay;
  }
  const command = program2.args[0];
}
